import React from "react";
import { Containering, Wrappering } from "./NewCrudStyle";
const NewCrudHooks = () => {
  return (
    <Wrappering>
      <Containering>
        <table border={1} width="50%">
          <thead>
            <tr>
              <td>Id</td>
              <td>Name</td>
              <td>Surname</td>
              <td>Status</td>
            </tr>
          </thead>
          <tbody>
            {Dating.map((value, index) => {
              <tr key={index}>
                <td>{value.id + 1}</td>
                <td>{value.name}</td>
                <td>{value.surname}</td>
                <td>{value.status}</td>
              </tr>;
            })}
          </tbody>
        </table>
      </Containering>
    </Wrappering>
  );
};

export default NewCrudHooks;
